import React, { Component } from 'react';
import Search from './search';
import Summary from './summary';
import searchInterestFreeCars from '../../services/searchInterestFreeCars';
import addDays from "date-fns/addDays";

class Main extends Component {
  constructor(props) {
    super(props);
    this.state = {
      price: 0,
      deposit: 0,
      years: 1,
      deliveryDate: addDays(new Date(), 1),
    };

    this.handleSearches = this.handleSearches.bind(this);
  }
  handleSearches(search) {
    console.log(search);
    this.setState({...search});
    this.searching();
  }
  async searching() {
    console.log(this.state.price);
    await searchInterestFreeCars(this.state.price).then((response)=>{
      console.log(response);
   }) 
  }
  render() {
    return (
      <div className="main">
        <main role="main">
        <header class="jumbotron">
            <div class="container">
               <div class="row">
                  <div class="col-md-7">
                    <Search searches={this.handleSearches}></Search>
                  </div>
                  <div class="col-md-5">
                    dewdewfew
                  </div>
               </div>
            </div>
         </header>
        <Search searches={this.handleSearches}></Search>
          <Summary 
            price={this.state.price}
            deposit={this.state.deposit}
            years={this.state.years}
            deliveryDate={this.state.deliveryDate}>
          </Summary>
        </main>
      </div>
    );
  }
}

export default Main;
